const ConvertDataForLineChart = (dataArray) => {
    const lineChartData = [];

    // Flatten the array of arrays into a single array of events
    const flattenedData = {} ;

    // Process each event
    flattenedData.forEach((event) => {
        const eventType = event.EventType;
        const startTimestamp = new Date(event.Start);
        const endTimestamp = new Date(event.End);
        const duration = endTimestamp - startTimestamp;

        const formattedData = {
            x: { start: startTimestamp, end: endTimestamp }, // Object containing the start and end of the event
            y: eventType // Use the event type as y coordinate
        };

        // Add the object to the data set for the line chart
        lineChartData.push(formattedData);
    });

    return lineChartData;
};

export default ConvertDataForLineChart;
